def solve(arr, target):
    left = 0
    right = len(arr) - 1

    while left <= right:
        mid = (left + right) // 2
        if arr[mid] == target and (mid == 0 or arr[mid - 1] != target):
            return mid
        elif arr[mid] >= target:
            right = mid - 1
        else:
            left = mid + 1

    return -1

def solve(arr, target):
    left = 0
    right = len(arr) - 1

    while left <= right:
        mid = (left + right) // 2
        if arr[mid] == target:
            while mid > 0 and arr[mid - 1] == target:
                mid -= 1
            return mid
        elif target < arr[mid]:
            right = mid - 1
        else:
            left = mid + 1
